import './App.css';
import Menu from './menu'; 
import { BrowserRouter, Route, Link ,Router} from 'react-router-dom';
const menus =[

   {   title:"Area1",poster:'./imge/2.png'},
   {   title:"Area2",poster:'./imge/1.png'},
   {   title:"Area3",poster:'./imge/2.png'},
   {   title:"Area4",poster:'./imge/2.png'},
   {   title:"SEOUL",poster:'./imge/2.png'}


]


class App extends Component {
  render() { 
      return(  



      <div className="App">

       {  menus.map((menup,index)=>{
      return   <Menu title={menup.title}  poster={menup.poster} key={index} />
       })}
     </div>
    );
 }
}


export default App;
